import React from "react";
import { useParams } from "react-router-dom";

import './Curriculums_review.css';

import {Disciplines_table, Estimates_table} from "./parts";
import ourCurriculumModel from "../common/common_values/ourCurriculum";
import GeneralInformationAboutCurriculum from "../common/GeneralInformationAboutCurriculum";
// import Disciplines_table from "../common/Disciplines_table";
// import {Disciplines_table, Estimates_table} from "../common/";

const Curriculums_review = ({curriculums, disciplines, skills, estimates}) => {
    
    const { id } = useParams();

    let disciplinesOurCurriculum = [];
    const ourCurriculum = ourCurriculumModel(id, curriculums);

    disciplines.forEach(el => {
        if (el.curriculum_id == id) disciplinesOurCurriculum.push(el);
    })
    
    return (
        <div className="app_content_table">
            <GeneralInformationAboutCurriculum ourCurriculum={curriculumForVisualization} />

            <div>
                <Disciplines_table disciplinesOurCurriculum={disciplinesOurCurriculum} />
            </div>

            <div>   
                <Estimates_table disciplinesOurCurriculum={disciplinesOurCurriculum} 
                                 skills={skills} estimates={estimates} />
            </div>
        </div>
    )
}

export default Curriculums_review;
